import { Link } from "react-router-dom"

const MemberTag = (props) => {

    const {name, avatar, member, set} = props

    if(set === 'undefined'){
       return set = console.log('Nothing was assigned to props.set in MemberTag')
    }

    console.log(avatar)

    return (
        <div style={{border: '1px solid black', padding: '20px'}} onClick={() => set()}>
            <Link to={{
                pathname: '/member',
                state: {
                    member: member
                }
            }}>
            <h2>Member Name: {name}</h2>
            <img src={`${avatar}`} alt='default profile' style={{width: '100px', height: '100px', borderRadius: '50%'}}/>
            </Link>
        </div>
    )
}

export default MemberTag
